import styled from 'styled-components';

const Container = styled.div`
  width: 100%;
  max-height: 500px;
`;

const FormContainer = styled.form`
  width: 100%;
  min-height: 120px;
  border-bottom: 1px solid #e6ecf0;
  padding: 10px;
  display: flex;
  flex-direction: column;
  position: relative;
`;

const PostForm = () => {
  return (
    <Container>
      <FormContainer>

      </FormContainer>
    </Container>
  )
};

export default PostForm;
